//import lib
import React from 'react';

//create a component
const NavbarComponent = () => {
    return (
        <nav className='navbar navbar-expand-lg navbar-light bg-light'>
            <a className='navbar-brand' href='/'>myUniversity</a>
        </nav>
    );
}

//export a component
export default NavbarComponent;
